import React, { useRef } from 'react';

const Index = () => {
	const Emailref = useRef(null);
	const Passwordref = useRef(null);
	return (
		<div
			style={{
				display: 'flex',
				justifyContent: 'center',
				alignItems: 'center',
				minHeight: '100vh',
				flexDirection: 'column'
			}}
		>
			<input placeholder="Email"></input>
			<input placeholder="Password" style={{ marginTop: '10px' }}></input>
			<button style={{ marginTop: '10px' }} onClick={() => alert('Chao em')}>
				Submit
			</button>
		</div>
	);
};

export default Index;
